import React, { useState } from 'react';
import { useParams } from 'react-router-dom';
import './DriverProfile.css'; // Ensure you update the CSS as well

const drivers = [
  {
    id: '1',
    name: 'Alfonso Bator',
    location: '750 Sarah Drive Sulphur, India',
    experience: '5 years',
    contact: {
      email: 'alphonsa@mail.com',
      phone: '+12 345 6789 0',
      location: 'Kerala, India',
    },
    vehicle: {
      busNumber: 'TN 2810 010-00',
      timings: '6 AM - 2 PM - 3 PM',
      students: 30,
      image: '/path-to-bus-image', // Update with the actual image URL
    },
  },
  // Add more drivers as needed
];

const DriverProfile = () => {
  const { driverId } = useParams();
  const driver = drivers.find((d) => d.id === driverId);
  const [showForm, setShowForm] = useState(false);
  const [showPayment, setShowPayment] = useState(false);

  const toggleForm = () => setShowForm(!showForm);
  const togglePayment = () => setShowPayment(!showPayment);

  if (!driver) {
    return <h2>Driver Not Found</h2>;
  }

  return (
    <div className="driver-profile">
      <h1>Driver Profile</h1>
      <div className="driver-details">
        <div className="profile-card">
          <h2>{driver.name}</h2>
          <p>{driver.location}</p>
          <p>Experience: {driver.experience}</p>
          <p>Email: {driver.contact.email}</p>
          <p>Phone: {driver.contact.phone}</p>
          <button onClick={togglePayment}>Show Payment Info</button>
        </div>

        <div className="vehicle-info">
          <h3>Vehicle</h3>
          <p>Bus No: {driver.vehicle.busNumber}</p>
          <p>Timings: {driver.vehicle.timings}</p>
          <p>Students: {driver.vehicle.students}</p>
          <img src={driver.vehicle.image} alt="Vehicle" />
        </div>
      </div>

      <button onClick={toggleForm} className="add-driver-btn">+ New Driver</button>

      {/* Form Overlay */}
      {showForm && (
        <div className="overlay" onClick={toggleForm}>
          <div className="modal" onClick={(e) => e.stopPropagation()}>
            <h2>Add New Driver</h2>
            <form>
              <input type="text" placeholder="Full Name" />
              <input type="date" placeholder="Date of Birth" />
              <input type="text" placeholder="Gender" />
              <input type="text" placeholder="Nationality" />
              <input type="text" placeholder="Vehicle No" />
              <input type="text" placeholder="Experience" />
              <input type="email" placeholder="Email" />
              <input type="text" placeholder="Phone Number" />
              <textarea placeholder="Address"></textarea>
              <input type="file" />
              <button type="submit">Add Driver</button>
            </form>
          </div>
        </div>
      )}

      {/* Payment Overlay */}
      {showPayment && (
        <div className="payment-overlay">
          <h3>Payments</h3>
          <p>Driver Salary</p>
          <p>Fuel Costs</p>
          <p>Bus Maintenance</p>
          <p>Damage Cover</p>
          <p>Insurance</p>
          <button onClick={togglePayment}>Close</button>
        </div>
      )}
    </div>
  );
};

export default DriverProfile;
